import React from 'react'
import './App.css';
import Home from "./Home"
import { Switch, Route} from 'react-router-dom'

function App() {
  return (
    <Switch>
      <Route exact path="/" component={Home} />
      <Route exact path="/N" component={Home} />
    </Switch>  
  );
}

export default App;
